import "./Card.css";

const Card = ({ datum }) => {
  const showalert = () => {
    window.alert('Selected' + datum.title + worth + datum.price );
  };

  return (
    <div className="card" onClick={showalert}>
      <div className="imgee">
        <img src={datum.image}></img>
      </div>
      <p className="wei">{datum.unit}</p>

      <p className="vegn">{datum.title}</p>
      <div className="fl">
        <p className="pri">{datum.price}</p>
        <img className="shop" src={datum.shop}></img>
        <img className="cart" src={datum.cart}></img>
      </div>
    </div>
  );
};

export default Card;
